def δ (x : ℕ) : ℕ :=
  if h : 0 < x then
    let divisors := {d ∈ Finset.range (x + 1) | d ∣ x ∧ odd d}
    in Finset.max' divisors (by { rw [Finset.nonempty_iff_ne_empty, ←Finset.range_succ, Finset.coe_range] at h, exact h })
  else 0

def δ (x : ℕ) : ℕ :=
  let divisors := {d | d ∣ x ∧ d % 2 = 1}
  Finset.max' (divisors.toFinset) ⟨1, by simp [Set.mem_set_of_eq, Nat.one_dvd]⟩
